<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8">
    <meta http-equiv="X-UA-Compatible" content="IE=Edge">
    <title>Tachyons Box Sizing - performance test</title>
    <meta name="author" content="mrmrs">
    <meta name="description" content="A small css module for a better box model">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <style type="text/css" media="screen">
      /* Box Sizing */
      div,
      article,
      section,
      main,
      footer,
      header,
      form,
      fieldset,
      pre,
      code,
      p,
      input[type="text"],
      input[type="tel"],
      input[type="email"],
      input[type="url"],
      input[type="password"] {
        box-sizing: border-box;
      }
      .cb {
        padding: .25em;
      }
    </style>
  </head>
